import {useState} from 'react'
import CarData from '../../data/CarData'
import { makeStyles } from '@material-ui/core/styles';
import './carFilter.css'

const useStyles = makeStyles({
    filterWrap: {
        width: '100vw',
        padding: '.5em',
        background: 'green',
        display: 'flex',
        justifyContent: 'center',
    },

  });


function 카리스트뷰() {
    const classes = useStyles();
    let [카데이터, 변동카데이터] = useState (CarData)
    return(
        <div className="CarListWrap">
            <차량필터/>
           {
               카데이터.map((a,i)=>{
                   return ( 
            <카정보컴포넌트 carlist={a}/>
                   )
               })
           }
        </div>
    )
}

export default 카리스트뷰

function 차량필터(props) {
    const classes = useStyles();

    return (
            <div className="filter">
                <button>대기</button>
                <button>경차</button>
                <button>소형</button>
                <button>중형</button>
                <button>대형</button>
                <button>승합</button>
            </div>

    )
}


function 카정보컴포넌트(props) {
    return(
        <>
        <div className="carList">
            <h2>{props.carlist.model}</h2>
            <p>{props.carlist.lisence_plate}</p>
            <p>{props.carlist.type}</p>
            <img src={props.carlist.carimg}/>
            <p>{props.carlist.location}</p>
        </div>
        <hr/>
        </>
    )

}
